<template>
  <q-toolbar style="border-radius: 5px">
    <q-toolbar-title> Convert {{cfg.name}} notation to .{{cfg.target}}</q-toolbar-title>
  </q-toolbar>

  <q-form class="q-mx-md" @submit.prevent="submit">
    
    <q-input
      v-model="notation"
      type="textarea"
      label="Notation"
      filled
    />

    <q-toggle
      v-model="fromBlack"
      :label="`Draw from ${fromBlack ? 'black' : 'white'}'s perspective`"
    />

    <div class="row justify-center">
      <q-btn
        type="submit"
        :loading="submitting"
        label="Convert"
      >
        <template #loading>
          <q-spinner />
        </template>
      </q-btn>
    </div>

    <q-separator class="q-my-md"/>

    <template v-if="image !== ''">
      <div class="row justify-center">
        <img :src="`data:image/${cfg.target};base64,${image}`" class="center"/>
      </div>
    </template>

    <template v-if="error !== ''">
      <div class="text-bold">Error: {{error}}</div>
    </template>

  </q-form>
</template>

<script lang="ts">
import { defineComponent, PropType, ref } from 'vue';
import { NotationConfig } from './models';

export default defineComponent({
  name: 'NotationTabPanel',
  props: {
    cfg: {
      type: Object as PropType<NotationConfig>,
      required: true
    }
  },
  setup: (props) => {
    const notation = ref(props.cfg.default);
    const fromBlack = ref(false);
    const submitting = ref(false);

    const image = ref('');
    const error = ref('');

    function submit() {
      submitting.value = true;

      let request = {
        'notation': notation.value,
        'from-white': !fromBlack.value
      };
      console.debug(`/${props.cfg.id}`, request);

      setTimeout(() => {
        submitting.value = false;
        if (request.notation === props.cfg.default) {
          image.value = defaultBase64Images[props.cfg.id];
        } else {
          error.value = 'invalid notation';
        }
      }, 2000);
    }

    return {notation, fromBlack, submit, submitting, image, error};
  }
});

const defaultBase64Images: {[key: string]: string} = {
  'fen': '',
  
  'pgn': ''
};
</script>
